import React from "react";


const General = (props) =>{
    const {generals} = props;
        return(
            <div>
                {generals.map((general) => {
                    return (
                        <div>
                            <h1 key={general.id}>{general.name}</h1>
                            <label></label>
                        </div>
                    )
                })}
            </div>
        )

    }

export default General
